import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import { viewProfile } from '../redux/authActions'

 const MyProfile = () => {
  const userId = useSelector( state => state.tokener.userId )
  console.log(userId)
    useEffect(() => {
      viewProfile(userId)
    },[])
    return(<>
      My Profile Page
    </>)
 }

 export default MyProfile
